/*View structure for view 01_view_stats_by_login */

/*!50001 DROP TABLE IF EXISTS `01_view_stats_by_login` */;
/*!50001 DROP VIEW IF EXISTS `01_view_stats_by_login` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `01_view_stats_by_login` AS (select cast(`a`.`login_datetime` as date) AS `login_date`,`b`.`user_desc` AS `users`,`a`.`ip_address` AS `ip_address`,count(0) AS `counts` from (`tbl_stats_login` `a` join `tbl_users` `b`) where (`a`.`user_id` = `b`.`user_id`) group by cast(`a`.`login_datetime` as date),`a`.`user_id` order by `a`.`login_datetime` desc) */;

/*View structure for view 02_view_stats_by_events */

/*!50001 DROP TABLE IF EXISTS `02_view_stats_by_events` */;
/*!50001 DROP VIEW IF EXISTS `02_view_stats_by_events` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `02_view_stats_by_events` AS (select max(`b`.`event_datetime`) AS `event_date`,`c`.`user_desc` AS `users`,`d`.`menu_name_th` AS `event_page`,`a`.`ip_address` AS `ip_address`,count(0) AS `counts` from (((`tbl_stats_login` `a` join `tbl_stats_events` `b`) join `tbl_users` `c`) join `tbl_menu` `d`) where ((`a`.`session_id` = `b`.`session_id`) and (`a`.`user_id` = `c`.`user_id`) and (`b`.`menu_id` = `d`.`menu_id`)) group by `a`.`user_id`,`b`.`menu_id`,date_format(`a`.`login_datetime`,_utf8'%d-%m-%Y') order by max(`b`.`event_datetime`) desc) */;

/*View structure for view 03_view_stats_by_date */

/*!50001 DROP TABLE IF EXISTS `03_view_stats_by_date` */;
/*!50001 DROP VIEW IF EXISTS `03_view_stats_by_date` */;

/*!50001 CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `03_view_stats_by_date` AS (select `01_view_stats_by_login`.`login_date` AS `login_date`,sum(`01_view_stats_by_login`.`counts`) AS `counts` from `01_view_stats_by_login` group by `01_view_stats_by_login`.`login_date` order by `01_view_stats_by_login`.`login_date` desc) */;

